import React from 'react';
import Data from '../data.json'
import { useParams } from "react-router-dom";
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import mark from '../components/icons/mark.png'
import L from 'leaflet';

export default function Region() {
    let { id } = useParams();

    let Icon = L.icon({
        iconUrl: mark,
        iconRetinaUrl: mark,
        iconAnchor: [5, 55],
        popupAnchor: [10, -44],
        iconSize: [30, 35],
    });

    {
        Data.map(post => {
            if (post.category == 1) {
                return (
                    <div className='propiedad'>
                        <h1>{post.tittle}</h1>

                        <MapContainer
                            className="map"
                            center={post.LATITUDE,post.LONGUITUDE}
                            zoom={13}
                            style={{ height: 300, width: "50%" }}
                        >
                            <TileLayer
                                attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                            />
                            <Marker position={post.LATITUDE, post.LONGUITUDE} icon={Icon} >
                                <Popup>
                                    Corretajes Bulltechs.
                </Popup>
                            </Marker>
                        </MapContainer>

                    </div>
                );
            }
        })
    }



}
